import axios from "axios";

function Slidebar() {
  const URL = process.env.REACT_APP_URL;
console.log(URL)
  const Slidebardata = async () => {
    const reponse = await axios.get(URL);
    console.log(reponse.data);
    return reponse.data;
  };
Slidebardata()
}
export default Slidebar;
